:underline\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttp://click2.money-revealed.com/t/DQ/AAI3Rg/AAKahQ/AI8qvg/AAFN3Q/ACbacA/AQ/Rqms\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1568319012876000\\u0026amp;usg\\u003dAFQjCNEVEPTZQB946aXl-9cm4arpeLpmCA\\\"\\u003etalking about a possible recession\\u003c/a\\u003e... but there\\u2019s one area upon which it\\u2019s having a positive impact: the prices of precious metals.\\u003c/p\\u003e\\r\\n\\r\\n\\r\\n\\r\\n\\u003cp style\\u003d\\\"margin:0 0 0 0;font-size:16px;line-height:24px;margin-bottom:24px;font-family:\\u0026#39;Helvetica\\u0026#39;,\\u0026#39;Arial\\u0026#39;,sans-serif\\\"\\u003eFrom the end of June to Sept. 4, bond yields dropped by a little over half a percent to a three-year low of 1.46%. At the same time, precious metals rose sharply\\u2026 in fact, according to \\u003ci\\u003eThe Wall Street Journal\\u003c/i\\u003e, gold hit a six-year record high while silver and platinum rose by 27.13% and 17.8%, respectively.\\u003csup\\u003e[1]\\u003c/sup\\u003e\\u003c/p\\u003e\\r\\n\\r\\n\\r\\n\\r\\n\\u003cp style\\u003d\\\"margin:0 0 0 0;font-size:16px;line-height:24px;margin-bottom:24px;font-family:\\u0026#39;Helvetica\\u0026#39;,\\u0026#39;Arial\\u0026#39;,sans-serif\\\"\\u003eSo why were investors suddenly interested in buying precious metals?\\u003c/p\\u003e\\r\\n\\r\\n\\r\\n\\r\\n\\u003cp style\\u003d\\\"margin:0 0 0 0;font-size:16px;line-height:24px;margin-bottom:24px;font-family:\\u0026#39;Helvetica\\u0026#39;,\\u0026#39;Arial\\u0026#39;,sans-serif\\\"\\u003eGold, silver and platinum tend to do well when the strength of the economy is in question. Whether or not the inverted yield curve is really a harbinger of economic decline, other global indicators \\u2014 such as falling currencies, from the euro to the yuan \\u2014 also have investors nervous.\\u003c/p\\u003e\\r\\n\\r\\n\\r\\n\\r\\n\\u003cp style\\u003d\\\"margin:0 0 0 0;font-size:16px;line-height:24px;margin-bottom:24px;font-family:\\u0026#39;Helvetica\\u0026#39;,\\u0026#39;Arial\\u0026#39;,sans-serif\\\"\\u003eWhen investors are nervous, they tend to seek refuge in the safety of precious metals.\\u003c/p\\u003e\\r\\n\\r\\n\\r\\n\\r\\n\\u003cp style\\u003d\\\"margin:0 0 0 0;font-size:16px;line-height:24px;margin-bottom:24px;font-family:\\u0026#39;Helvetica\\u0026#39;,\\u0026#39;Arial\\u0026#39;,sans-serif\\\"\\u003eGold and silver are traditionally safe bets when the market is shaky or, as the case is currently, simply doing unusual things. The predictability of precious metals rising in value at times like this is consistent historically, so it\\u2019s not surprising to see the current rise.\\u003c/p\\u003e\\r\\n\\r\\n\\r\\n\\r\\n\\u003cp style\\u003d\\\"margin:0 0 0 0;font-size:16px;line-height:24px;margin-bottom:24px;font-family:\\u0026#39;Helvetica\\u0026#39;,\\u0026#39;Arial\\u0026#39;,sans-serif\\\"\\u003eHow can you benefit from the boom in precious metal values? Should you take the plunge and invest? And if so, how?\\u003c/p\\u003e\\r\\n\\r\\n\\r\\n\\r\\n\\u003cp class\\u003d\\\"m_-1713589940858174917centered\\\" style\\u003d\\\"margin:0 0 0 0;font-size:16px;line-height:24px;margin-bottom:24px;font-family:\\u0026#39;Helvetica\\u0026#39;,\\u0026#39;Arial\\u0026#39;,sans-serif;text-align:center\\\"\\u003e\\u003cimg class\\u003d\\\"m_-1713589940858174917centered\\\" src\\u003d\\\"https://ci5.googleusercontent.com/proxy/ZjWBoA4bsEv2zx1RZ_wNx3TibBUmhxqriNDj1auZFCFJC8p4hIopxXQInc7w3TFzq-3NNJrP8JxFT2Y9YrsnWS5a1mYzT8K23A7-gwOWnDNCTFLzZHil_3ikRQxv5g\\u003ds0-d-e1-ft#https://s3.amazonaws.com/sap-uploads/wp-content/uploads/2019/09/mre9112.png\\\" alt\\u003d\\\"gold\\\" style\\u003d\\\"outline:none;text-decoration:none;clear:both;display:block;width:auto;max-width:100%;float:none;margin:0 auto\\\"\\u003e\\u003c/p\\u003e\\r\\n\\r\\n\\r\\n\\r\\n\\u003cp style\\u003d\\\"margin:0 0 0 0;font-size:16px;line-height:24px;margin-bottom:24px;font-family:\\u0026#39;He y\\\"\\u003e\\r\\n\\u003cdiv id\\u003d\\\"m_2379176115948978888hs_cos_wrapper_hs_email_body\\\" class\\u003d\\\"m_2379176115948978888hs_cos_wrapper m_2379176115948978888hs_cos_wrapper_widget m_2379176115948978888hs_cos_wrapper_type_rich_text\\\" style\\u003d\\\"color:inherit;font-size:inherit;line-height:inherit\\\"\\u003e\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eHi  there,\\u00a0\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eLet me ask you a quick question. And I want you to \\u003ci\\u003ereally \\u003c/i\\u003ethink about your answer!\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003e\\u003cstrong\\u003eWhat does your dream job look like?\\u003c/strong\\u003e\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eAnd no, I don\\u2019t mean what job title do you want. What I mean is...what is it like to DO your dream job, on a daily basis? How does it fit into the rest of your life?\\u00a0\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003e\\u003ci\\u003eAre you picturing it?\\u003c/i\\u003e\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eWould your hours be flexible? Allowing you to be there for important family moments?\\u00a0\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eWould you want to be able to work from anywhere and skip the commute?\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eOr maybe for you, it\\u2019s just about doing work you ACTUALLY care about?\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eLet me let you in on a little secret: your dream job doesn\\u2019t have to be a \\u003ci\\u003edream\\u003c/i\\u003e.\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eBut you do need to decide to make it happen.\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eLet me tell you about Antonia\\u2026\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eAntonia, a Skillcrush alum who\\u2019s now working as a Front End Web Developer, spent six years at home with her kid before she was ready to jump back into the workforce. As you can imagine, she was worried she wouldn\\u2019t be able to do it.\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eBut she had a vision:\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003e\\u003ci\\u003e\\u201cSome years ago, I was traveling down the escalator in the London Underground, and I saw an advert: \\u201cLearn computer skills.\\u201d I had a vision of sitting at a desk in my home, working flexible hours, children running around me, earning a decent wage and dictating my own hours.\\u201d\\u003c/i\\u003e\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eSo, despite her fear, she decided to give it a try. In the process she found Skillcrush, enrolled in a course, and the rest is history, as you say. ;)\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003e\\u003ci\\u003e\\u201cThis may not be everyone\\u0026#39;s idea of their future career\\u2014\\u003cstrong\\u003ebut \\u003c/strong\\u003e\\u003c/i\\u003e\\u003cstrong\\u003e\\u003ci\\u003emy dream has literally come\\u003c/i\\u003e\\u003c/strong\\u003e\\u003ci\\u003e\\u003cstrong\\u003e true\\u003c/strong\\u003e. Now that I have tech skills, I do work flexible hours from home as a freelancer, plus I also recently landed my first \\u0026quot;proper\\u0026quot; job in seven years as a junior web developer, which also allows me to work from home for most of the week.\\u201d\\u003c/i\\u003e\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eNow it\\u2019s YOUR turn to get the career AND life you\\u2019ve been imagining. Come learn how at our upcoming, live webinar:\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003e\\u003ca href\\ d\\\"left\\\"\\u003e\\r\\n\\u003cdiv class\\u003d\\\"m_2379176115948978888widget-span m_2379176115948978888widget-type-email_body\\\"\\u003e\\r\\n\\u003cdiv id\\u003d\\\"m_2379176115948978888hs_cos_wrapper_hs_email_body\\\" class\\u003d\\\"m_2379176115948978888hs_cos_wrapper m_2379176115948978888hs_cos_wrapper_widget m_2379176115948978888hs_cos_wrapper_type_rich_text\\\" style\\u003d\\\"color:inherit;font-size:inherit;line-height:inherit\\\"\\u003e\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eHi  there,\\u00a0\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eLet me ask you a quick question. And I want you to \\u003ci\\u003ereally \\u003c/i\\u003ethink about your answer!\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003e\\u003cstrong\\u003eWhat does your dream job look like?\\u003c/strong\\u003e\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eAnd no, I don\\u2019t mean what job title do you want. What I mean is...what is it like to DO your dream job, on a daily basis? How does it fit into the rest of your life?\\u00a0\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003e\\u003ci\\u003eAre you picturing it?\\u003c/i\\u003e\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eWould your hours be flexible? Allowing you to be there for important family moments?\\u00a0\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eWould you want to be able to work from anywhere and skip the commute?\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eOr maybe for you, it\\u2019s just about doing work you ACTUALLY care about?\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eLet me let you in on a little secret: your dream job doesn\\u2019t have to be a \\u003ci\\u003edream\\u003c/i\\u003e.\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eBut you do need to decide to make it happen.\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eLet me tell you about Antonia\\u2026\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eAntonia, a Skillcrush alum who\\u2019s now working as a Front End Web Developer, spent six years at home with her kid before she was ready to jump back into the workforce. As you can imagine, she was worried she wouldn\\u2019t be able to do it.\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eBut she had a vision:\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003e\\u003ci\\u003e\\u201cSome years ago, I was traveling down the escalator in the London Underground, and I saw an advert: \\u201cLearn computer skills.\\u201d I had a vision of sitting at a desk in my home, working flexible hours, children running around me, earning a decent wage and dictating my own hours.\\u201d\\u003c/i\\u003e\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eSo, despite her fear, she decided to give it a try. In the process she found Skillcrush, enrolled in a course, and the rest is history, as you say. ;)\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003e\\u003ci\\u003e\\u201cThis may not be everyone\\u0026#39;s idea of their future career\\u2014\\u003cstrong\\u003ebut \\u003c/strong\\u003e\\u003c/i\\u003e\\u003cstrong\\u003e\\u003ci\\u003emy dream has literally come\\u003c/i\\u003e\\u003c/strong\\u003e\\u003ci\\u003e\\u003cstrong\\u003e true\\u003c/strong\\u003e. Now that I have tech skills, I do work flexible hours from home as a freelancer, plus I also recently landed my first \\u0026quot;proper\\u0026quot; job in seven years as a junior web developer, which also allows me to work from home for most of the week.\\u201d\\u003c/i\\u003e\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-bottom:1em\\\"\\u003eNow it\\u2019s YOUR turn to get the career AND life you\\u2019ve been imagining. Come le font-size:16px;line-height:24px;margin-bottom:24px;font-family:\\u0026#39;Helvetica\\u0026#39;,\\u0026#39;Arial\\u0026#39;,sans-serif\\\"\\u003eGold, silver and platinum tend to do well when the strength of the economy is in question. Whether or not the inverted yield curve is really a harbinger of economic decline, other global indicators \\u2014 such as falling currencies, from the euro to the yuan \\u2014 also have investors nervous.\\u003c/p\\u003e\\r\\n\\r\\n\\r\\n\\r\\n\\u003cp style\\u003d\\\"margin:0 0 0 0;font-size:16px;line-height:24px;margin-bottom:24px;font-family:\\u0026#39;Helvetica\\u0026#39;,\\u0026#39;Arial\\u0026#39;,sans-serif\\\"\\u003eWhen investors are nervous, they tend to seek refuge in the safety of precious metals.\\u003c/p\\u003e\\r\\n\\r\\n\\r\\n\\r\\n\\u003cp style\\u003d\\\"margin:0 0 0 0;font-size:16px;line-height:24px;margin-bottom:24px;font-family:\\u0026#39;Helvetica\\u0026#39;,\\u0026#39;Arial\\u0026#39;,sans-serif\\\"\\u003eGold and silver are traditionally safe bets when the market is shaky or, as the case is currently, simply doing unusual things. The predictability of precious metals rising in value at times like this is consistent historically, so it\\u2019s not surprising to see the current rise.\\u003c/p\\u003e\\r\\n\\r\\n\\r\\n\\r\\n\\u003cp style\\u003d\\\"margin:0 0 0 0;font-size:16px;line-height:24px;margin-bottom:24px;font-family:\\u0026#39;Helvetica\\u0026#39;,\\u0026#39;Arial\\u0026#39;,sans-serif\\\"\\u003eHow can you benefit from the boom in precious metal values? Should you take the plunge and invest? And if so, how?\\u003c/p\\u003e\\r\\n\\r\\n\\r\\n\\r\\n\\u003cp class\\u003d\\\"m_-1713589940858174917centered\\\" style\\u003d\\\"margin:0 0 0 0;font-size:16px;line-height:24px;margin-bottom:24px;font-family:\\u0026#39;Helvetica\\u0026#39;,\\u0026#39;Arial\\u0026#39;,sans-serif;text-align:center\\\"\\u003e\\u003cimg class\\u003d\\\"m_-1713589940858174917centered\\\" src\\u003d\\\"https://ci5.googleusercontent.com/pro
